import './App.css';

function App() {
  return (
    <div className='word-app'>
      <h1>Welcome to Word App</h1>
      <div className='message'>
        <p>Wrong Answer</p>
      </div>
      <div className='content'>
        <div className='board'>
          <p className='square-bg'></p>
        </div>
        <p className='scrambled-word'></p>
        <div className='field'>
          <input type="text" name="" id="" />
          <button type='button'>Enter</button>
        </div>
        <button className='start-button'></button>
      </div>
    </div>
  );
}

export default App;
